import './ForTest.css'
import { motion } from "framer-motion"
 
function ForTest(){
    const count = useMotionValue(0)
    const rounded = useTransform(count, latest => Math.round(latest))
    
    useEffect(() => {
        const controls = animate(count, 100)
        return controls.stop
    }, [])
    
    return 
    (
    <motion.div>
        {rounded}
    </motion.div>
    )
}

export default ForTest
